<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>For Makayla ❤️</title>
    <link href="https://fonts.googleapis.com/css2?family=Crimson+Pro:wght@300;400;600&family=Playfair+Display:wght@700;900&display=swap" rel="stylesheet">
    <style>
        :root {
            --rose: #ff6b9d;
            --deep-rose: #c44569;
            --cream: #fff5f7;
            --soft-pink: #ffd4e5;
            --charcoal: #2d2d2d;
        }

        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }

        body {
            font-family: 'Crimson Pro', serif;
            background: linear-gradient(135deg, var(--cream) 0%, var(--soft-pink) 100%);
            min-height: 100vh;
            display: flex;
            align-items: center;
            justify-content: center;
            overflow-x: hidden;
            position: relative;
        }

        /* Floating hearts background */
        .heart-bg {
            position: fixed;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            pointer-events: none;
            z-index: 0;
        }

        .heart {
            position: absolute;
            font-size: 20px;
            opacity: 0;
            animation: float 15s infinite;
        }

        @keyframes float {
            0% {
                transform: translateY(100vh) rotate(0deg);
                opacity: 0;
            }
            10% {
                opacity: 0.6;
            }
            90% {
                opacity: 0.3;
            }
            100% {
                transform: translateY(-100px) rotate(360deg);
                opacity: 0;
            }
        }

        /* Floating photos */
        .floating-photo {
            position: fixed;
            width: 150px;
            height: 150px;
            border-radius: 20px;
            object-fit: contain;
            box-shadow: 0 10px 30px rgba(0, 0, 0, 0.2);
            border: 4px solid white;
            animation: floatPhoto 20s infinite ease-in-out;
            z-index: 1;
            pointer-events: none;
            background: white;
        }

        .floating-photo:nth-child(1) {
            top: 10%;
            left: 5%;
            animation-delay: 0s;
        }

        .floating-photo:nth-child(2) {
            top: 15%;
            right: 8%;
            animation-delay: 3s;
        }

        .floating-photo:nth-child(3) {
            bottom: 15%;
            left: 10%;
            animation-delay: 6s;
        }

        .floating-photo:nth-child(4) {
            bottom: 20%;
            right: 5%;
            animation-delay: 9s;
        }

        @keyframes floatPhoto {
            0%, 100% {
                transform: translateY(0px) rotate(0deg);
            }
            25% {
                transform: translateY(-20px) rotate(2deg);
            }
            50% {
                transform: translateY(-10px) rotate(-2deg);
            }
            75% {
                transform: translateY(-25px) rotate(1deg);
            }
        }

        /* Floating flowers */
        .flower {
            position: absolute;
            font-size: 30px;
            opacity: 0;
            animation: floatFlower 12s infinite;
        }

        @keyframes floatFlower {
            0% {
                transform: translateY(100vh) rotate(0deg);
                opacity: 0;
            }
            10% {
                opacity: 0.8;
            }
            90% {
                opacity: 0.4;
            }
            100% {
                transform: translateY(-100px) rotate(360deg);
                opacity: 0;
            }
        }

        .container {
            position: relative;
            z-index: 2;
            text-align: center;
            padding: 60px 40px;
            max-width: 700px;
            background: rgba(255, 255, 255, 0.95);
            border-radius: 30px;
            box-shadow: 0 30px 80px rgba(255, 107, 157, 0.3);
            backdrop-filter: blur(10px);
            animation: slideUp 1s ease-out;
        }

        @keyframes slideUp {
            from {
                opacity: 0;
                transform: translateY(50px);
            }
            to {
                opacity: 1;
                transform: translateY(0);
            }
        }

        .top-photo {
            width: 200px;
            height: 200px;
            border-radius: 50%;
            object-fit: cover;
            margin: 0 auto 30px;
            display: block;
            border: 5px solid var(--rose);
            box-shadow: 0 15px 40px rgba(255, 107, 157, 0.4);
            animation: fadeIn 1s ease-out 0.3s both;
        }

        h1 {
            font-family: 'Playfair Display', serif;
            font-size: 3.5rem;
            color: var(--deep-rose);
            margin-bottom: 30px;
            font-weight: 900;
            letter-spacing: -1px;
            animation: fadeIn 1s ease-out 0.6s both;
        }

        @keyframes fadeIn {
            from {
                opacity: 0;
                transform: translateY(20px);
            }
            to {
                opacity: 1;
                transform: translateY(0);
            }
        }

        .buttons {
            display: flex;
            gap: 20px;
            justify-content: center;
            flex-wrap: wrap;
            animation: fadeIn 1s ease-out 0.9s both;
            margin-top: 40px;
        }

        button {
            font-family: 'Crimson Pro', serif;
            font-size: 1.2rem;
            font-weight: 600;
            padding: 18px 50px;
            border: none;
            border-radius: 50px;
            cursor: pointer;
            transition: all 0.3s ease;
            letter-spacing: 0.5px;
        }

        .yes-btn {
            background: linear-gradient(135deg, var(--rose) 0%, var(--deep-rose) 100%);
            color: white;
            box-shadow: 0 10px 30px rgba(255, 107, 157, 0.4);
        }

        .yes-btn:hover {
            transform: translateY(-3px) scale(1.05);
            box-shadow: 0 15px 40px rgba(255, 107, 157, 0.5);
        }

        .no-btn {
            background: white;
            color: var(--deep-rose);
            border: 2px solid var(--rose);
            position: relative;
            transition: all 0.5s cubic-bezier(0.68, -0.55, 0.265, 1.55);
        }

        .no-btn:hover {
            background: var(--cream);
        }

        .celebration {
            display: none;
            margin-top: 30px;
            font-size: 1.5rem;
            color: var(--deep-rose);
            font-weight: 600;
            animation: bounce 0.6s ease;
        }

        @keyframes bounce {
            0%, 100% { transform: translateY(0); }
            50% { transform: translateY(-20px); }
        }

        .emoji-burst {
            position: fixed;
            font-size: 3rem;
            pointer-events: none;
            animation: burst 1s ease-out forwards;
        }

        @keyframes burst {
            0% {
                opacity: 1;
                transform: translate(0, 0) scale(1);
            }
            100% {
                opacity: 0;
                transform: translate(var(--tx), var(--ty)) scale(0);
            }
        }

        @media (max-width: 600px) {
            .floating-photo {
                width: 100px;
                height: 100px;
            }
            
            .top-photo {
                width: 150px;
                height: 150px;
            }
            
            h1 {
                font-size: 2.5rem;
            }
            
            button {
                font-size: 1.1rem;
                padding: 15px 40px;
            }
        }
    </style>
</head>

    <div class="heart-bg" id="flowerBg"></div>

        <h1>Will you be my Valentine Makayla!!! ❤️</h1>
        
        <div class="buttons">
            <button class="yes-btn" onclick="sayYes()">Yes! 💕</button>
            <button class="no-btn" id="noBtn" onclick="moveButton()">No</button>
        </div>
        
        <div class="celebration" id="celebration">
            YAY 🎉
        </div>
    </div>

    <script>
        // Create floating hearts
        function createHeart() {
            const heart = document.createElement('div');
            heart.className = 'heart';
            heart.innerHTML = '❤️';
            heart.style.left = Math.random() * 100 + 'vw';
            heart.style.animationDelay = Math.random() * 5 + 's';
            heart.style.fontSize = (Math.random() * 20 + 15) + 'px';
            document.getElementById('heartBg').appendChild(heart);
            
            setTimeout(() => heart.remove(), 15000);
        }

        // Create floating flowers
        function createFlower() {
            const flowers = ['🌹', '🌺', '🌸', '🌼', '🌻', '💐', '🌷'];
            const flower = document.createElement('div');
            flower.className = 'flower';
            flower.innerHTML = flowers[Math.floor(Math.random() * flowers.length)];
            flower.style.left = Math.random() * 100 + 'vw';
            flower.style.animationDelay = Math.random() * 5 + 's';
            document.getElementById('flowerBg').appendChild(flower);
            
            setTimeout(() => flower.remove(), 12000);
        }

        // Generate hearts and flowers continuously
        setInterval(createHeart, 800);
        setInterval(createFlower, 1000);
        
        for (let i = 0; i < 10; i++) {
            setTimeout(createHeart, i * 300);
            setTimeout(createFlower, i * 400);
        }

        function sayYes() {
            document.getElementById('celebration').style.display = 'block';
            document.querySelector('.buttons').style.display = 'none';
            
            // Create emoji burst
            for (let i = 0; i < 30; i++) {
                setTimeout(() => createEmojiBurst(), i * 50);
            }
        }

        function createEmojiBurst() {
            const emojis = ['💕', '💖', '💗', '💝', '💘', '❤️', '🌹'];
            const emoji = document.createElement('div');
            emoji.className = 'emoji-burst';
            emoji.innerHTML = emojis[Math.floor(Math.random() * emojis.length)];
            emoji.style.left = '50%';
            emoji.style.top = '50%';
            emoji.style.setProperty('--tx', (Math.random() - 0.5) * 500 + 'px');
            emoji.style.setProperty('--ty', (Math.random() - 0.5) * 500 + 'px');
            document.body.appendChild(emoji);
            
            setTimeout(() => emoji.remove(), 1000);
        }

        function moveButton() {
            const btn = document.getElementById('noBtn');
            const container = document.querySelector('.container');
            
            // Get random position
            const maxX = window.innerWidth - btn.offsetWidth - 100;
            const maxY = window.innerHeight - btn.offsetHeight - 100;
            
            const randomX = Math.random() * maxX;
            const randomY = Math.random() * maxY;
            
            btn.style.position = 'fixed';
            btn.style.left = randomX + 'px';
            btn.style.top = randomY + 'px';
        }
    </script>
</body>
